Prezados Senhores Generais e Comandantes das Forças Armadas Brasileiras, Marinha, Exército e Aeronáutica,

Acreditamos que por muito medo da condição de ditadura do judiciário brasileiro, intensificada desde 2019, ainda não fomos tão explícitos como talvez seremos agora.

Estamos há mais de 20 dias demonstrando o sentimento que nos assombra nos últimos  anos e pedindo POR FAVOR sua interferência na RESTAURAÇÃO do devido processo democrático em nosso país.

O povo não acredita mais no sistema CORRUPTO instalado entre legislativo e judiciário e entende ter havido uma ruptura total nas relações institucionais em nosso país, situação nítida por todas as últimas decisões arbitrárias, inconstitucionais, tomadas por alguns membros da nossa suprema corte.

Por medo, centenas de milhares de pessoas estão acampadas em frente aos quartéis de todo o Brasil, locais onde existe a SENSAÇÃO DE SEGURANÇA, para pessoas de idade, mães de família, adolescentes e até crianças, que nitidamente estão DESEPERADAS com os rumos que nosso país está tomando.

Hoje só nos resta uma ÚTIMA esperança, pois não estamos tratando de uma questão de vitória eleitoral de A ou B, estamos falando de uma ruptura institucional real pela interferência do poder judiciário e suas atitudes ditatoriais, passando por cima de muitas ordens e responsabilidades estritamente dos poderes executivo e legislativo.

POR FAVOR, reestabeleçam a ordem democrática o mais breve possível, antes que para isso, tenhamos que perder vidas de pessoas inocentes, trabalhadoras, honestas e sobre tudo patriotas, fazendo tudo isso para libertar nosso Brasil.

O que nós pedimos nada mais é que se CUMPRA A CONSTITUIÇÃO! Dever que os Srs juraram defender perante a nossa bandeira. 

Nós solicitamos e autorizamos a sua atuação imediata.

